import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';
import '../css/foundation/assets/css/foundation.css';
import ResponsiveMenu from 'react-responsive-navbar';
import { FaBars, FaWindowMinimize } from 'react-icons/fa';

const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <ResponsiveMenu
      id='navBar'
      menuOpenButton={<FaBars size={30} />}
      menuCloseButton={<FaWindowMinimize size={30} />}
      changeMenuOn="40em"
      largeMenuClassName='nav'
      smallMenuClassName=''
      menu={
        <ul className='nav-content'>
          <Services />
          <About />
          <Philantrophy />

          <img src={logo}
            className='nav-logo'
            alt='logo'
            onClick={scrollToTop} />
        </ul>
      }
    />
  );
}

export default Navbar;
